    payments on Schedule H4, supporting Line 21(a), were for employees that did not
    spend over 25% of thier compensated time on Federal activity.      2.  Niether
    the Fundraising Consultant or Management Consultant on Schedule H4 were employees
    of the Committee.  The Fundraising consultant was paid using the allocation ratio
    for the fundraising event she was planning.  The Management Consultant also spent
    under 25% of his time on federal activity, though he was not an employee.     3.
